    [],nt"revision_timestamp": "2015-06-17T01:57:35.349915",nt"name": "relative-efficiency-of-gill-netting-methods-in-bristol-bay",nt"isopen":
    false,nt"url": null,nt"notes": "The objectives of this study are to evaluate
    the relative efficiency of different types of fishing gear in Bristol Bay during
    1956 and to determine whether those values can be realistically used to compute
    the table of effort for use in 1957. After the close of the 1956 season, a preliminary
    study of the relative efficiency of gill nets was conducted for the Egegik and NaknekKvichak
    areas. The results obtained indicated that the large twoman drift boats were about
    twice as efficient as the oneman drift boats and from four to ten times as efficient
    as set nets. An analysis of the data is included.",nt"license_title": "License
